My thoughts on Links Awakening so far. Loving it! Stays very true to the original game but with gorgeous visuals & great music. The writing is hilarious, the gameplay feels improved over the original & it just feels like a nice classic Zelda experience all around. The only drawback is some of the framerate drops, here's hoping for a patch to fix it but it doesn't break the game. What do you think of it? 
